import React from 'react';
import s from './../Navbar.module.css';
import {NavLink} from "react-router-dom";
const Nav = ()=>{
    return (
    <div className={s.item}>
        <NavLink to="/profile" activeClassName={s.active}>Profilgge</NavLink>
    </div>
    )
}
export default Nav;
